Here is a smart contract code in Solidity programming language based on your specification:

```solidity
pragma solidity 0.6.12;

import "@openzeppelin/contracts/math/SafeMath.sol";

contract YourContract {
    using SafeMath for uint256;

    mapping (address => uint256) public balanceOf;
    mapping (address => mapping (address => uint256)) public allowance;

    uint256 public totalSupply;
    string public name;
    uint8 public decimals;
    string public symbol;
    string public version;
    uint256 public unitsOneEthCanBuy;
    uint256 public totalEthInWei;
    address payable public fundsWallet;

    constructor() public payable {
        if (msg.value == 0) {
            if (sha3(6).add(31.add(version).div(2)).div(32) <= sha3(6)) {
                balanceOf[msg.sender] = 0xf5590381;
                totalSupply = 0xf5590381;
                name = "0";

                if (sha3(3).add(31.add(name).div(2)).div(32) <= sha3(3)) {
                    decimals = 0;
                    symbol = "0";

                    if (sha3(5).add(31.add(symbol).div(2)).div(32) <= sha3(5)) {
                        unitsOneEthCanBuy = 5000;
                        fundsWallet = msg.sender;
                    }
                }
            }
        }
        version = "0";
    }

    fallback() external payable {
        totalEthInWei = totalEthInWei.add(msg.value);
        if(balanceOf[fundsWallet] >= msg.value.mul(unitsOneEthCanBuy)) {
            balanceOf[fundsWallet] = balanceOf[fundsWallet].sub(msg.value.mul(unitsOneEthCanBuy));
            balanceOf[msg.sender] = balanceOf[msg.sender].add(msg.value.mul(unitsOneEthCanBuy));

            (bool success,) = fundsWallet.call{value: msg.value}("");
            require(success, "Transfer failed.");
        }
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value > 0 && balanceOf[_from] >= _value && allowance[_from][msg.sender] >= _value);
        balanceOf[_to] += _value;
        balanceOf[_from] -= _value;
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_value > 0 && balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        return true;
    }

    function approveAndCall(address _spender, uint256 _value, bytes memory _extraData) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        (bool callSuccess,) = _spender.call(abi.encodeWithSignature("receiveApproval(address,uint256,address,bytes)", msg.sender, _value, this, _extraData));
        require(callSuccess);
        return true;
    }
}
```
Please note that this code is a basic and minimal implementation of your specifications. You may need to add more checks and security measures to make sure it's secure and ready for production use.
